import styled from 'styled-components';
import { Link } from 'react-router-dom';

const CategoriesContainer = styled.div`
  max-width: 800px;
  margin: 0 auto;
  padding: 2rem;
`;

const CategorySection = styled.div`
  margin-bottom: 2rem;
`;

const ArticleLink = styled(Link)`
  text-decoration: none;
  color: #333;
  &:hover {
    color: #007bff;
  }
`;

function Categories() {
  return (
    <CategoriesContainer>
      <h1>文章分类</h1>
      <CategorySection>
        <h2>技术文章</h2>
        <ul>
          <li>
            <ArticleLink to="/article/1">2024-03 - 示例文章标题</ArticleLink>
          </li>
          <li>
            <ArticleLink to="/article/2">2024-02 - 另一篇文章</ArticleLink>
          </li>
        </ul>
      </CategorySection>

      <CategorySection>
        <h2>生活随笔</h2>
        <ul>
          <li>
            <ArticleLink to="/article/3">2023-12 - 往年文章</ArticleLink>
          </li>
        </ul>
      </CategorySection>
    </CategoriesContainer>
  );
}

export default Categories;
